import "./Input.css";

const TimeSelector = () => {
  const numbersList = [...Array(60).keys()]
  const numbers = numbersList.map(number =>
    <option value="number">{number}</option>)

  return (
    <label>
      Pick a fruit:
      <select name="selectedTime">
        {numbers}
      </select>
    </label>
  );
};

export default TimeSelector;
